const Home = () => {
    return(
        <>
        <div className="welcome">
        <div style={{ marginTop: '-45px'}} className="d-flex flex-column w-100 vh-100 align-items-center justify-content-center">
            <h1>Hi Friends <strong>Good Evening!</strong></h1>
            <p className="font-weight-300" style={{ fontSize: '16px'}}>Welcome to our React CRUD application</p>
        </div>
        </div>
        </>
    )
}

export default Home;
